/*
 * This is the primary high-level API for the project. In this folder there should be:
 * A class called InsightFacade, this should be in a file called InsightFacade.ts.
 * You should not change this interface at all or the test suite will not work.
 */

export enum InsightDatasetKind {
	Sections = "sections",
	Rooms = "rooms",
}

export interface InsightDataset {
	id: string;
	kind: InsightDatasetKind;
	numRows: number;
}

export interface InsightResult {
	[key: string]: string | number;
}

export class InsightError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, InsightError);
	}
}

export class NotFoundError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, NotFoundError);
	}
}

export class ResultTooLargeError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, ResultTooLargeError);
	}
}

export interface IInsightFacade {
	/**
	 * Add a dataset to insightUBC.
	 *
	 * @param id  The id of the dataset being added. Follows the format /^[^_]+$/
	 * @param content  The base64 content of the dataset. This content should be in the form of a serialized zip file.
	 * @param kind  The kind of the dataset
	 *
	 * @return Promise <string[]>
	 *
	 * The promise should fulfill on a successful add, reject for any failures.
	 * The promise should fulfill with a string array,
	 * containing the ids of all currently added datasets upon a successful add.
	 * The promise should reject with an InsightError describing the error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 * If id is the same as the id of an already added dataset, the dataset should be rejected and not saved.
	 *
	 * After receiving the dataset, it should be processed into a data structure of
	 * your design. The processed data structure should be persisted to disk; your
	 * system should be able to load this persisted value into memory for answering
	 * queries.
	 *
	 * Ultimately, a dataset must be added or loaded from disk before queries can
	 * be successfully answered.
	 */
	addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]>;

	/**
	 * Remove a dataset from insightUBC.
	 *
	 * @param id  The id of the dataset to remove. Follows the format /^[^_]+$/
	 *
	 * @return Promise <string>
	 *
	 * The promise should fulfill upon a successful removal, reject on any error.
	 * Attempting to remove a dataset that hasn't been added yet counts as an error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 *
	 * The promise should fulfill the id of the dataset that was removed.
	 * The promise should reject with a NotFoundError (if a valid id was not yet added)
	 * or an InsightError (invalid id or any other source of failure) describing the error.
	 *
	 * This will delete both disk and memory caches for the dataset for the id meaning
	 * that subsequent queries for that id should fail unless a new addDataset happens first.
	 */
	removeDataset(id: string): Promise<string>;

	/**
	 * Perform a query on insightUBC.
	 *
	 * @param query  The query to be performed.
	 *
	 * If a query is incorrectly formatted, references a dataset not added (in memory or on disk),
	 * or references multiple datasets, it should be rejected.
	 *
	 * @return Promise <InsightResult[]>
	 *
	 * The promise should fulfill with an array of results.
	 * The promise should reject with a ResultTooLargeError (if the query returns too many results)
	 * or an InsightError (for any other source of failure) describing the error.
	 */
	performQuery(query: unknown): Promise<InsightResult[]>;

	/**
	 * List all currently added datasets, their types, and number of rows.
	 *
	 * @return Promise <InsightDataset[]>
	 * The promise should fulfill an array of currently added InsightDatasets, and will only fulfill.
	 */
	listDatasets(): Promise<InsightDataset[]>;
}

import {
	IInsightFacade,
	InsightDataset,
	InsightDatasetKind,
	InsightError,
	InsightResult,
	NotFoundError,
	ResultTooLargeError,
} from "./IInsightFacade";

import JSZip from "jszip";
import {SectionsList} from "../classes/SectionsList";
import * as fs from "fs-extra";
import * as pq from "./performQueryHelper";
import * as ds from "./datasetHelper";
import {RoomsList} from "../classes/RoomsList";
import {Building} from "../classes/Building";
import {BuildingList} from "../classes/BuildingList";
import {Rooms} from "../classes/Rooms";
import {parse} from "parse5";
import {findTable, findTBody, geoLocator, helper} from "./roomsHelper";


/**
 * This is the main programmatic entry point for the project.
 * Method documentation is in IInsightFacade
 *
 */
export default class InsightFacade implements IInsightFacade {
	constructor() {
		// console.log("InsightFacadeImpl::init()");
	}

	public allID: string[] = [];

	public async addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		if (!ds.isIDKindValid(id, kind)) {
			return Promise.reject(new InsightError());
		}

		// check if id is already in allID
		if (this.allID.includes(id)) {
			return Promise.reject(new InsightError());
		}

		try{
			if (kind === InsightDatasetKind.Sections) {
				return this.addDatasetSection(id, content, kind);
			}
			if (kind === InsightDatasetKind.Rooms) {
				return this.addDatasetRooms(id, content, kind);
			}
		} catch (error) {
			return Promise.reject(new InsightError());
		}
		return this.allID;
	}

	public async addDatasetRooms(id: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		try {
			// Use parse5 to parse the HTML content
			let buildingList: BuildingList = new BuildingList();
			const zip = new JSZip();
			let tmp = await zip.loadAsync(content, {base64: true});

			const dataList = new RoomsList(id, kind);

			// check if zip contains index.htm
			const indexFile = await tmp.files["index.htm"].async("string");

			// console.log(indexFile);

			if (!indexFile) {
				return Promise.reject(new InsightError());
			}

			const document = parse(indexFile);

			if (!findTable(document)) {
				return Promise.reject(new InsightError());
			}

			findTBody(document, buildingList);

			for (let building of buildingList.getBuildingList()) {
				geoLocator(building, buildingList);
				if (building.getLat() === 404 && building.getLon() === 404) {
					buildingList.removeBuilding(building);
				}
			}

			// go to the folder that contains the html files
			const folder = zip.folder("campus/discover/buildings-and-classrooms");
			// console.log(folder);
			if (!folder) {
				return Promise.reject(new InsightError());
			}

			// go through each file in the folder
			const files = folder.file(/.+/); // regex to match any file name
			await helper(files, buildingList, dataList);

			if (dataList.getNumberOfSections() === 0) {
				return Promise.reject(new InsightError());
			}

			this.allID.push(id);
			await ds.writeDataToDisk(dataList, id);
		} catch (error) {
			return Promise.reject(new InsightError());
		}
		return this.allID;
	}

	public async addDatasetSection(id: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		try {
			const dataList = new SectionsList(id, kind);

			const zip = new JSZip();
			await zip.loadAsync(content, {base64: true});
			const coursesFolder = zip.folder("courses");

			// Check if there is a courses folder
			if (!coursesFolder) {
				return Promise.reject(new InsightError());
			}

			const files = coursesFolder.file(/.+/); // regex to match any file name
			if (!files || files.length === 0) {
				return Promise.reject(new InsightError());
			}

			// Use Promise.all to process all files in parallel and store the results in an array
			const fileContentsPromises = files.map(async (file) => {
				const fileContent = await file.async("text");
				try {
					const fileJson = JSON.parse(fileContent);
					ds.isDataValid(fileJson, dataList);
				} catch (err) {
					// skip
				}
			});

			await Promise.all(fileContentsPromises);

			if (dataList.getNumberOfSections() === 0) {
				return Promise.reject(new InsightError());
			}
			this.allID.push(id);
			// print allId
			// console.log(this.allID);
			await ds.writeDataToDisk(dataList, id);
		} catch (err) {
			return Promise.reject(new InsightError());
		}
		return this.allID; // stub
	}

	public removeDataset(id: string): Promise<string> {
		// When id is invalid
		if (
			id.includes("_") ||
			id === " " ||
			id.length === 0 ||
			id === "\t" ||
			id === "\n" ||
			id === "\r" ||
			id === "\f" ||
			id === "\v"
		) {
			return Promise.reject(new InsightError());
		}

		// When id is not in allID
		if (!this.allID.includes(id)) {
			return Promise.reject(new NotFoundError());
		}

		const filename = id + ".json";
		const filePath = "./data/" + filename;
		fs.remove(filePath).then().catch();

		// remove id from allID
		const index = this.allID.indexOf(id);
		if (index > -1) {
			this.allID.splice(index, 1);
		}

		return Promise.resolve(id);
	}

	public async listDatasets(): Promise<InsightDataset[]> {
		const datasetList: InsightDataset[] = [];
		const dataDir = "./data";

		try {
			await fs.ensureDir(dataDir);
			const files = fs.readdirSync(dataDir);

			// Create an array of promises to read and parse the JSON files concurrently
			const filePromises = files.map(async (file) => {
				const id = file.split(".")[0];
				// find the kind
				let kind = InsightDatasetKind.Sections;

				let numRows = 0;

				try {
					const filePath = `${dataDir}/${file}`;
					const fileContents = await fs.readFile(filePath, "utf8");
					const jsonData = JSON.parse(fileContents);

					const tmp = jsonData["kind"];
					if (tmp === "rooms") {
						kind = InsightDatasetKind.Rooms;
					}

					if (jsonData && jsonData.sectionList && Array.isArray(jsonData.sectionList)) {
						numRows = jsonData.sectionList.length;
					}

					if (jsonData && jsonData.roomsList && Array.isArray(jsonData.roomsList)) {
						numRows = jsonData.roomsList.length;
					}
				} catch (error) {
					// Handle errors here, or skip as needed
				}
				// console.log(id, kind, numRows);
				// Check if numRows is greater than 0 before pushing to the datasetList
				if (numRows > 0) {
					datasetList.push({id, kind, numRows});
				}
			});

			// Wait for all file promises to resolve
			await Promise.all(filePromises);
		} catch (error) {
			// don't need to handle for list
		}
		return Promise.resolve(datasetList);
	}

	/**
	 * @param query  The query to be performed.
	 * @return Promise <InsightResult[]>
	 */
	public async performQuery(query: unknown): Promise<InsightResult[]> {
		try {
			// validate query body & initiate necessary variables
			pq.queryValidator(query);
			let knownQuery = query as any;
			// console.log(1);
			let idString: string = pq.getID(knownQuery);
			// console.log(2);
			// parsedJSON: contains the JSONs that match idString
			let parsedJSON = await pq.getJSON(idString);
			// console.log(3);
			// filteredJSON: contains the JSONs that passed WHERE
			let whereFilteredJSON = pq.filterWhere(parsedJSON, knownQuery);
			// console.log(whereFilteredJSON);
			// console.log(4);
			// transformedJSON: Group and Apply has been applied
			let transformedJSON = pq.transform(whereFilteredJSON, knownQuery["TRANSFORMATIONS"]);
			// console.log(transformedJSON);
			// console.log(5);
			// passedList: contains InsightResults that passed Options
			let passedList = pq.filterOptions(transformedJSON, knownQuery, idString);
			// console.log(passedList);
			// console.log(6);
			// sort query results
			let sortedList = pq.sortQuery(passedList, knownQuery);

			return Promise.resolve(sortedList);

		} catch (error) {
			if (error instanceof ResultTooLargeError) {
				return Promise.reject(new ResultTooLargeError());
			} else {
				return Promise.reject(new InsightError());
			}
		}
	}
}

